import React, {useState} from "react";
import { data } from "../../pages/datas/data";

function Carousel() {

  const [current, setCurrent] = useState(0)

  return (
    <div>
      {data.map((location, index) => {
        return (
          <img src={location.pictures} alt="imagecover"></img>
        )
      })}
    </div>
  );
}

export default Carousel;
